<span class="token comment"># \u9664\u4E86 \`git log\` \u4FE1\u606F\u4E4B\u5916\uFF0C\u5305\u542B\u54EA\u4E9B\u6587\u4EF6\u88AB\u66F4\u6539\u4E86\uFF0C\u4EE5\u53CA\u6BCF\u4E2A\u6587\u4EF6\u76F8\u5BF9\u7684\u589E\u5220\u884C\u6570</span>
